<script src="../../../../api/Statistics/BaseInfo/WellPosition.js"></script>
<template>
  <div class="dashboard-container">
    <div class="dashboard-editor-container">
    <el-row :gutter="32">
      <el-col style="margin-top:40px">
        <h4 style="margin-top:10px;text-align: center">井位图</h4>
        <div ref="well" :class="className" :style="{height:height,width:width}" style="margin-top: 10px" />
      </el-col>
    </el-row>
  </div>
  </div>
</template>

<script>
import * as echarts from 'echarts'
require('echarts/theme/macarons') // echarts theme
import { debounce } from '@/utils'
import Image from '@/assets/images/postion.jpg'
import request from "../../../utils/request";

const animationDuration = 6000
var icon = "image://data:image/jpeg;base64,"

export default {
  props: {
    className: {
      type: String,
      default: 'chart'
    },
    width: {
      type: String,
      default: '100%'
    },
    height: {
      type: String,
      default: '600px'
    }
  },
  data() {
    return {
      Image: Image,
      chart: null,
      data: [],
      charData: [],
      downloadLoading: false
    }
  },
  watch: {
    data: {
      deep: true,
      handler(newVal) {
        if (newVal) {
          this.initChart()
        }
      }
    }
  },
  mounted() {
    this.getWellPosition()
    this.__resizeHandler = debounce(() => {
      if (this.chart) {
        this.chart.resize()
      }
    }, 100)
    window.addEventListener('resize', this.__resizeHandler)
  },
  beforeDestroy() {
    if (!this.chart) {
      return
    }
    this.chart.dispose()
    this.chart = null
  },
  methods: {
    getWellPosition() {
      setTimeout(() => {
          request({
            url: 'statistics/wellPosition/all',
            method: 'get',
          }).then(res => {
          console.log(res)
          this.data = null
          this.data = res
          this.initChart()
        })
      }, 100)
    },

    tableRowClassName({ row, rowIndex }) {
      if (rowIndex % 2 !== 1) {
        return 'success-row'
      }
      return ''
    },

    handleEdit(index, row, key, value) {
    },

    initChart() {
      this.chart = echarts.init(this.$refs.well) // 'macarons'
      this.chart.setOption({
        grid: {
          // backgroundColor: 'rgb(6,33,68)',
          // borderColor: '#fff',
          // shadowColor: '#0f375f',
          // show: true,
          width: '500px',
          height: '500px',
          left: '20%',
          bottom: '10%',

        },
        dataset: {
          // 用 dimensions 指定了维度的顺序。直角坐标系中，
          // 默认把第一个维度映射到 X 轴上，第二个维度映射到 Y 轴上。
          // 这里把’x‘对应的数值映射到X轴，‘y'对应的数值映射到Y轴
          // source里面的数据为[{'name':'启迪','x':12345,'y':654651}，{...},{...},...]
          dimensions: ['utmx', 'utmy', 'wellName'],
          source: this.data
        },
        legend: {
          // right: 10,
          // data: ['x y'],
          selectedMode: false,
          orient: 'vertical',
          right: '10%',
          bottom: '10%',
          itemHeight: 155, // 修改icon图形大小
          itemWidth: 155,
          icon: icon,

        },
        toolbox: {
          right: 10,
          show: true,
          feature: {
            dataZoom: {
              xAxisIndex: 'none'
            },
            dataView: {readOnly: false},
            magicType: {type: ['line', 'bar']},
            restore: {},
            saveAsImage: {}
          }
        },
        xAxis: {
          name: 'm',
          splitNumber: 6,
          splitLine: { // 网格线
            lineStyle: {
              type: 'dashed' // 设置网格线类型 dotted：虚线   solid:实线
            },
            show: true // 隐藏或显示
          },
          axisLine: {
            show: true,
            lineStyle: {
              color: '#ccc'
            }
          },
          //  坐标从最小值开始
          min: 318668 - 500,
          max: 325554 + 500,
          scale: true
        },
        yAxis: {
          name: 'm',
          splitNumber: 6,
          splitLine: { // 网格线
            lineStyle: {
              type: 'dashed' // 设置网格线类型 dotted：虚线   solid:实线
            },
            show: true //  隐藏或显示
          },
          axisLine: {
            show: true,
            lineStyle: {
              color: '#ccc'
            }
          },
          min: 2346138 - 500,
          max: 2353025 + 500,
          scale: true
        },
        series: [{
          name: ' ',
          type: 'scatter',
          label: {
            // 直接显示标签
            show: true,
            // color: '',
            formatter: function(param) {
              // param.data 是每一行对应的数据 在这里为对象格式
              return param.data.wellName // 2
            },
            position: 'top',
            fontWeight: 'lighter',
            fontSize: 10,
            // 鼠标放上去显示
            emphasis: {
              show: true,
              formatter: function(param) {
                // return [param.data.wellName, param.data.utmx, param.data.utmy]
                return [param.data.wellName]
              },
              position: 'top',
              fontWeight: 'normal',
              fontSize: 13
            },
            animationDuration
          },
          // 散点的颜色形状
          itemStyle: {
            normal: {
              shadowBlur: 10,
              shadowColor: 'rgba(120, 36, 50, 0.5)',
              shadowOffsetY: 5,
              color: new echarts.graphic.RadialGradient(0.4, 0.3, 1, [{
                offset: 0,
                color: 'rgb(251, 118, 123)'
              }, {
                offset: 1,
                color: 'rgb(204, 46, 72)'
              }])
            }
          }
        }]
      })
    }
  }
}
</script>
